import pymongo


class Mongo:
    def __init__(
            self,
            database
    ):
        try:
            uri = "mongodb://{0}:{1}@{2}:{3}/".format(MONGO_USER, MONGO_PWD, MONGO_HOST, MONGO_PORT)
            client = pymongo.MongoClient(uri)
            self.db = client[database]
        except Exception as e:
            print(e.args)

    def insert(self, collection_name, item, filter_field):
        condition = {filter_field: item[filter_field]}
        collection = self.db[collection_name]
        if collection.find_one(condition):
            collection.update_one(condition, {"$set": item})
            print("更新：", item[filter_field])
        else:
            collection.insert_one(item)
            print("插入", item[filter_field])

    def findall(self, collection_name):
        collection = self.db[collection_name]
        results = collection.find()
        return results

    def find(self, collection_name, condition):
        collection = self.db[collection_name]
        result = collection.find_one(condition)
        return result


